n: rand_with_step(4,6,1);
lsg1: 0.2^n;
test01(x):= is(x>=0) and is(x<=1);
test02(x):= integerp(x) and is(x>0);
lsgZwischen1: 1/5;
lsgZwischen2: (0.2)^(n);
tr(de,en):=castext("[[lang code='de']]{@de@}[[/lang]][[lang code='en']]{@en@}[[/lang]]");
lsgZwischen3: [[1, false, tr("Poisson-Verteilung","poisson distribution")], [2, false, tr("Exponentialverteilung","eponential distribution")], [3, true, tr("Binomialverteilung","binominal distribution")], [4, false, tr("Multinomialverteilung","multinomial distribution")] ];
lsgZwischen4: n;
lsgZwischen5: 1/5;
lsg2: binomial(n,3)*0.2^3*0.8^(n-3);
lsgC: 1- binomial(n,0)*0.8^n - binomial(n,1)*0.2*0.8^(n-1) - binomial(n,2)*0.2^2*0.8^(n-2);
